const Search = ({ query, queryFunction, completed, completedFunction }) => {



    return (
        <>
            <label>Search:</label>
            <input
                type="text"
                name="q"
                id="q"
                value={query}
                onChange={queryFunction}
            // onChange={(e)=>queryFunction(e.target.value)}
            />
            <label>Show completed:</label>
            <input
                type="checkbox"
                value={completed}
                onChange={completedFunction}
            />
        </>
    )

}

export default Search;
